import React, { useState } from "react";
import "./Sregister.css";
import { useNavigate } from "react-router-dom";


const Sregister = () =>{

  const navigate= useNavigate();

  const[students,setStudent]= useState({
      name:"", email:"", password:"", cpassword:"" , board:"", classs:"", contactNumber:"", presentAddress:"",primelocation:"", subjects:""});
    let name, value;
    const handleInputs=(e)=>{
    console.log(e);
    name= e.target.name;
    value= e.target.value;
  
    setStudent({...students, [name]:value});
  
  }

const PostData = async (e) => {
  e.preventDefault();
console.log(e)
  const {name, email, password, cpassword, board, classs, contactNumber, presentAddress, primelocation, subjects}= students;
  
   const res = await fetch("/studentregister",{
     method:"POST",
     headers:{
       "Content-type":"application/json"
     },
     body: JSON.stringify({
      name, email, password, cpassword, board, classs, contactNumber, presentAddress,primelocation, subjects
     })
   });
   const data = await res.json();
   console.log(data)
   if (data.status === 422 || !data) {
     window.alert("Information not filled");
     console.log("Information not filled");
   }else{
     window.alert("successfully received");
     console.log("successfully received");

     navigate("/");
    }
}


// 

  return (
    <>
    
    <formabc>
    <h1a>Student Registration</h1a>      
      <labelx>
        <b>Full Name</b>
        <input
          type="text"
          name= "name"
          value={students.name}
          onChange={handleInputs} required ="true"/>
      </labelx>
      <labelb>
        <b>Email</b>
        <input
          type="string"
          name="email"
          value={students.email}
          onChange={handleInputs} required ="true"
        />
        {/* {errors.email && <div className="error">{errors.email}</div>} */}
      </labelb>
      <labelb>
       <b>Password</b>
        <input
          type="string"
          name="password"
          value={students.password}
          onChange={handleInputs} required ="true"
        />
        {/* {errors.password && <div className="error">{errors.password}</div>} */}
      </labelb>
      <labelb>
        <b>Confirm Password</b>
        <input
          type="string"
          name="cpassword"
          value={students.cpassword}
          onChange={handleInputs} required ="true"></input>
        {/* {errors.confirmPassword && (
          <div className="error">{errors.confirmPassword}</div>
        )} */}
      </labelb>
      <labelb>
       <b>Board</b> 
        <input
          type="text"
          name="board"
          value={students.board}
          onChange={handleInputs} required ="true"
        />
        {/* {errors.education && <div className="error">{errors.education}</div>} */}
      </labelb>
      <labelb>
        <b>Class</b>
        <select name="classs" value={students.classs} onChange={handleInputs} required ="true">
          {Array.from({ length: 12 }, (_, index) => index + 1).map((number) => (
            <option value={number} key={number}>
              {number}
            </option>
          ))}
        </select>
      </labelb>



      <labelb>
       <b>Contact Number</b> 
        <input
          type="number"
          name="contactNumber"
          value={students.contactNumber}
          onChange={handleInputs} required="true"
        />
        {/* {errors.contactNumber && (
          <div className="error">{errors.contactNumber}</div>
        )} */}
      </labelb>
      <labelb>
        <b>Present Address</b>
        <textarea
          name="presentAddress"
          value={students.presentAddress}
          onChange={handleInputs} required="true"
        />
        {/* {errors.presentAddress && (
          <div className="error">{errors.presentAddress}</div>
        )} */}
      </labelb>
      <labelb>
        <b>Prime Location</b>
        <input
          type="string"
          name="primelocation"
          value={students.primelocation}
          onChange={handleInputs} required="true"
        />
        {/* {errors.presentAddress && (
          <div className="error">{errors.presentAddress}</div>
        )} */}
      </labelb>
    
  
  <labelb>
    <b>Subject required</b>
    <input
      type="text"
      name="subjects"
      value={students.subjects}
      onChange={handleInputs} required="true"
    />
    {/* {errors.subjects && <div className="error">{errors.subjects}</div>} */}
  </labelb>
  <labelb>
        <b>Address Proof</b>
        <select name="addressProofa" value={students.addressProofa} onChange={handleInputs} required="true">
          <option value="Aadhar">Aadhar Card</option>
          {/* <option value="DL">Driving License</option> */}
          <option value="passport">Passport</option>
          
        </select>
      </labelb>
  <labelb>
    <b>Address proof</b>
    
    <input
      type="file"
      name="addressProof"
      // value={student.addressProof}
      onChange={handleInputs} required="true"
    />
   
  
  </labelb>
  
  <labelb>
        <b>Any Queries?</b>
        <textarea
        name="Query"
          value={student.Query}
          onChange={handleInputs} required="true"
        />
        {/* {errors.Query && (
          <div className="error">{errors.Query}</div>
        )} */}
      </labelb>

      <input type="submit" className='button contact_submit_button' value="Register" onClick={PostData}></input>
  {/* <button type="submit">Register</button> */}
</formabc>
</>
 );
}

export default Sregister;
